import React, { useEffect, useState } from "react";
import "./Home.css";
import img1 from "../image/icon.png";
import Nav_bar from "./Navbar";
function Home(props) {
  const [loading, setloading] = useState(false);
  useEffect(() => {
    setloading(true);
    setTimeout(() => {
      setloading(false);
    }, 4000);
  }, []);
  return (
    <>
      {loading ? (
        <div loading={loading} className="loading">
          <img src={img1} alt="" />
        </div>
      ) : (
        <Nav_bar />
      )}
    </>
  );
}

export default Home;
